estrenamos el video
'De la basura' como parte de la programación #CulturaVirtual de @icppr en Facebok.

La basura como problema y eje central en el contexto caribeño es un tema que aún no se resuelve. ¿Qué hacer con la basura? ¿Dónde terminan los materiales reciclados? ¿Quién puede parar los desechos tóxicos? ¿Qué va ocurrir con el agua que contaminan los vertederos?  Vivimos entre basura y seguimos generando distintos contaminantes sin ningún control. 

El re uso y re valorización de los materiales que encontramos tirados en cada esquina es una conversación importante dentro del trabajo artístico contemporáneo.  DE LA BASURA es una exploración de títeres y manipulación de objetos con el fin de generar preguntas.   Los objetos se presentan tal cual o con muy poca construcción para evidenciar la materia prima: basura. La improvisación y la exploración en esta historia son técnicas que pretenden lograr el debate entre espectadores

Agradecemos a @neaarts por el apoyo para esta presentación.

